 import React from "react";
class sari extends React.Component{
    constructor(props){
        super(props);
        this.state={
            value:0
        }
    }
    
    hanmdeLInc=()=>{
        this.setState({
            value:this.state.value+1
        
        })
    }
    hanmdeLDec=()=>{
        this.setState({
            value:this.state.value-1
        })
    }
    render(){
        return(
            <div>
                {this.state.value}<br/>

                <br/>
                <button onClick={this.hanmdeLInc}>increment</button><br/>
                <button onClick={this.hanmdeLDec}>decrement</button>

            </div>
        )
    }
}
export default sari;
